import TicketTable from "components/Cards/TicketTable";
import { Container, Row, Col, Button } from "react-bootstrap";
import { Link } from "react-router-dom";
export default function NewTicket() {
  return (
    <center>
  <Container>

  
    <Row>
    <div className="container-fluid">
      <TicketTable/>
    </div>
    </Row>
  </Container>
  </center>
  );
}
